import Section from "../../common/Section";
import Skill from "./Skill";
import {
  SiHtml5,
  SiCss3,
  SiJavascript,
  SiJquery,
  SiPhp,
  SiReact,
  SiNodeDotJs,
  SiAmazon,
  SiMysql,
  SiMongodb,
  SiGit,
} from "react-icons/si";
const SkillSection = () => {
  return (
    <Section title="Skills" component={Skill} scroll content={skills}></Section>
  );
};

const skills = [
  {
    id: 1,
    icon: <SiJavascript />,
    color: "#F7DF1B",
    category: "Front-end",
    name: "JavaScript",
    level: 4,
  },

  {
    id: 2,
    icon: <SiReact />,
    color: "#5ED4F4",
    category: "Front-end",
    name: "React.js",
    level: 3,
