    color: "#2A65F0",
    category: "Front-end",
    name: "CSS",
    level: 4,
  },
  {
    id: 5,
    icon: <SiJquery />,
    color: "#0F66A9",
    category: "Front-end",
    name: "JQuery",
    level: 4,
  },

  {
    id: 6,
    icon: <SiPhp />,
    color: "#787BB3",
    category: "Back-end",
    name: "PHP",

    level: 4,
  },
  {
    id: 7,
