  {
    id: 10,
    icon: <SiMongodb />,
    color: "#489242",
    category: "Database",
    name: "MongoDB",
    level: 2,
  },
  {
    id: 11,
    icon: <SiGit />,
    color: "#E94F31",
    category: "Etc",
    name: "Git",
    level: 3,
  },
];

export default SkillSection;
